import React from 'react';
import styled from 'rn-css';
import { colors, Text } from '@mevron/cross-core/components/typo';
import { TextInput } from '@mevron/cross-core/components/Forms';

const Container = styled.View`
    background-color: #fff;
    border-radius: 10px;
    padding: 15px;
`;

const GenerateButton = styled.TouchableOpacity`
    height: 40px;
    width: 200px;
    background-color: ${colors.defaultColor};
    border-radius: 5px;
    justify-content: center;
    align-items: center;
`;

const GenerateButtonText = styled(Text)`
    color: #fff;
`;

export default function SearchComponents({ searchType }) {
    const typeLists = {
        FileName: 'Search by File Name',
        Name: 'Search by first name or last name',
        ChargeNumber: 'Search by Court Charge Number',
        FileNumber: 'Search by File Number',
        CaseType: 'Search by Case Type',
        StaffActivities: 'Search by Staffs Activities',
        CaseEndorsement: 'Search by Case Endorsement',
    };

    return (
        <Container>
            <TextInput title={typeLists[searchType]} />
            <GenerateButton>
                <GenerateButtonText>Search</GenerateButtonText>
            </GenerateButton>
        </Container>
    );
}
